import React from 'react';
import './App.css';
import { Table } from 'react-bootstrap';

// class StockTable extends React.Component {
//
// }

class App extends React.Component {

  constructor(props) {
    super(props);
    this.updateTickers = this.updateTickers.bind(this);
    this.updatePeRatios = this.updatePeRatios.bind(this);
    this.state = {
      tickers: [],
      pe_ratios: [],
    }
  }

  updateTickers(e) {
    this.setState({tickers: e.target.value});
  }

  updatePeRatios(e) {
    this.setState({pe_ratios: e.target.value});
  }

  render() {
    return (
        <Table striped bordered hover variant="dark">
          <thead>
          <tr>
            <th>#</th>
            <th>First Name</th>
            <th>Last Name</th>
            <th>Username</th>
          </tr>
          </thead>
          <tbody>
          <tr>
            <td>1</td>
            <td>Mark</td>
            <td>Otto</td>
            <td>@mdo</td>
          </tr>
          <tr>
            <td>2</td>
            <td>Jacob</td>
            <td>Thornton</td>
            <td>@fat</td>
          </tr>
          <tr>
            <td>3</td>
            <td colSpan="2">Larry the Bird</td>
            <td>@twitter</td>
          </tr>
          </tbody>
        </Table>
    )
  }
}

export default App;
